if(a==="godDestiny")return"Strong chance of god tiering upon death, with shenanigans getting their corpse where it needs to go. Not applicable for deaths that happen on Skaia, as no amount of shenanigans is going to rocket their corpse off planet. "
if(a==="godTier")return"Starts the game already god tier. Somehow. Hey. It's YOUR decision. Don't blame me if SBURB behaves weird, you hacker."
