if(a==="dead")return"You monster. Whatever. The player died before entering the Medium due to suitably dramatic shenanigans. Hopefully someone will be available to corpse smooch them back to life once they get into the Medium."
if(a==="robot")return"Robots are obviously superior to fleshy players. "
if(a==="Species")return"Trolls are ever so slightly less mentally stable than humans and tend towards FAR more annoying quirks."
if(a==="HairColor")return"Hair color is purely cosmetic. Certain hairstyles will have highlights which are mandated to be the Player's favorite color (which is aspect color for humans and blood color for trolls). "
if(a==="Interests")return"Interests alter the topics a player knows about (including their skill at finding topics to rap about), some of the rungs on their echeladder, their land,  and their derived ChatHandle."
